import React, { Fragment } from 'react';
import MobileLayoutLevel2 from '../../components/layouts/MobileLayoutLevel2';
import css from '../../styles/main.scss';

const Withdrawals = prop => {
  return (
    <Fragment>
      <MobileLayoutLevel2 title="變更資料">
        <div
          className={css.mobileBox_nobg}
          style={{ height: 700, paddingBottom: 80 }}
        >
          <div style={{ textAlign: 'center', marginBottom: 30 }}>
            <div style={{ color: 'white', marginBottom: 10 }}>在線客服</div>
            <img
              src="/images/qrCode.png"
              alt=""
              className="img-responsive"
              style={{ height: 123 }}
            />
          </div>
          <div
            style={{
              height: 74,
              backgroundColor: '#d8d8d8',
              borderRadius: 3,
              marginBottom: 30,
              padding: '0 20px',
              display: 'flex',
              justifyContent: 'space-between',
              alignItems: 'center'
            }}
          >
            <img
              src="/images/line-messenger.svg"
              alt=""
              className="img-responsive"
              style={{ height: 55 }}
            />
            <div>@888pi</div>
          </div>
          <div
            style={{
              height: 74,
              backgroundColor: '#d8d8d8',
              borderRadius: 3,
              marginBottom: 30,
              padding: '0 20px',
              display: 'flex',
              justifyContent: 'space-between',
              alignItems: 'center'
            }}
          >
            <div>@意見反饋</div>
            <div>8888pipipi@gmail.com</div>
          </div>
        </div>
      </MobileLayoutLevel2>
    </Fragment>
  );
};

export default Withdrawals;
